import { Table, Tbody, Tr, Td} from "@chakra-ui/react";

const TableElement = (props) => {
  return(
    <Table borderWidth="1px" borderColor="white">
      <Tbody>
        <Tr>
            <Td color="#FFF">{props.name}</Td>
            <Td color="#FFF">{props.email}</Td>
            <Td color="#FFF">{props.cpf}</Td>
            <Td color="#FFF">{}</Td>
        </Tr>
      </Tbody>
    </Table>
  );
}

export default TableElement;
